import { HttpAuth } from '../../config/Http';
import { useDispatch } from 'react-redux';

export function index () {
  let items;

  HttpAuth.get('/item')
    .then( (response) => {
      dispatch({
        type: 'INDEX',
        response
    });
    } )
}
